import React, { useEffect, useState } from 'react';

function Recommendations() {
  const [data, setData] = useState([]);

  useEffect(() => {
    setTimeout(() => {
      setData([
        { id: 1, name: 'Goa' },
        { id: 2, name: 'Manali' },
        { id: 3, name: 'Kerala' },
      ]);
    }, 1000);
  }, []);

  return (
    <div>
      <h1>Recommendations</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default Recommendations;
